import React, { Component } from 'react'
import { getById } from './Audi/carsData/carsDataRes';

export class carS extends Component {

    state = {
        product: {}
    }

    componentDidMount() {
        const id = this.props.match.params.id;
        getById(id)
            .then(product => {
                console.log(product);
            })
    }

    render() {
        return (
            <div>
                Car Ssssssssssssssssss
            </div>
        )
    }
}

export default carS
